import React from 'react';
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';
import Home from './pages/Home';
import Packages from './pages/Packages';
import Admin from './pages/Admin';
import Discounts from './pages/Discounts';
import Recommendations from './pages/Recommendations';

function App() {
  return (
    <Router>
      <div className="min-h-screen bg-gray-100 text-gray-800">
        {/* Navbar */}
        <header className="bg-white shadow p-4 flex justify-between items-center">
          <h1 className="text-2xl font-bold text-blue-600">MMT Clone</h1>
          <nav className="space-x-4">
            <Link to="/" className="text-gray-600 hover:text-blue-600">Home</Link>
            <Link to="/packages" className="text-gray-600 hover:text-blue-600">Packages</Link>
            <Link to="/admin" className="text-gray-600 hover:text-blue-600">Admin</Link>
            <Link to="/discounts" className="text-gray-600 hover:text-blue-600">Discounts</Link>
            <Link to="/recommendations" className="text-gray-600 hover:text-blue-600">Recommendations</Link>
          </nav>
        </header>

        {/* Routing */}
        <Routes>
          <Route path="/" element={<Home />} />
          <Route path="/packages" element={<Packages />} />
          <Route path="/admin" element={<Admin />} />
          <Route path="/discounts" element={<Discounts />} />
          <Route path="/recommendations" element={<Recommendations />} />
        </Routes>

        <footer className="text-center py-4 text-sm text-gray-500 border-t mt-10">
          © 2025 MakeMyTrip Clone – Built with ❤️
        </footer>
      </div>
    </Router>
  );
}

export default App;
